	(5491,3674,32678,'24/mayo - Rexville el lister me dice que se le estan haciendo arreglos al apt y que estara listo el viernes pero que primero el mostrara a sus prospectos y si no sucede nada, entonces lo puedo mostrar.Hable con el Gerente: Milton y envio un memo a Caguas porque la clienta llamo de la pag de Reality. Luego le pusieron al listado en la pagina \"pendiente\". Para cubrir le ofreci a la cliente mostrar Altos de Torrimar, lo cual fue otro mal evento para la clienta ya que el listado no tiene el numero del apart. y espero mas de 30 mins la clienta a lo que la lister me contestaba y me enviaba el texto del num del apt. Al otro dia el lister de Rexville me envio un mensaje diciendome que la propiedad esta fuera del mercado hasta nuevo aviso.','2016-06-01 22:20:09'),
